import ExpenseItem from './ExpenseItem'

const ExpenseList = (props) => {

  let expensesContent = <p>No expenses founddd.</p>;

  if (props.items.length > 0) {
    expensesContent =
      props.items.length.map((expense) => (
        <ExpenseItem
          key={expense.id}
          title={expense.title}
          amount={expense.amount}
          date={expense.date}
        />
      ));
  }

